import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import { Tabs, Tab } from "react-bootstrap";
import classes from "./TopTabs.module.css";


class TopTabs extends Component {
	render() {
		return (
			<>
				<div className={classes.threeTabs}>
					<Tabs
						defaultActiveKey="home"
						transition={false}
						id="noanim-tab-example"
					>
						<Tab eventKey="All" title="All" className={classes.tab}></Tab>
                        <Tab eventKey="Sparkling Drinks" title="Sparkling Drinks" className={classes.tab}></Tab>
						<Tab eventKey="Grains" title="Grains" className={classes.tab}></Tab>
						<Tab eventKey="Meat Cans" title="Meat Cans"></Tab>
					</Tabs>
				</div>
			</>
		);
	}
}

export default TopTabs;
